import{_ as s,o as t,c as _,e as r}from"./chunks/framework.nzJD8CNM.js";const a="/assets/IMG_8723.kL543qro.jpg",o="/assets/IMG_8744.wVGSHVzM.jpg",p="/assets/IMG_8746.t8ht9AYW.jpg",e="/assets/IMG_8748.s3NJA7-m.jpg",c="/assets/IMG_8749.3XlT2VNy.jpg",i="/assets/IMG_8763.gI0zF3MK.jpg",m="/assets/IMG_8764.ra7He98t.jpg",g="/assets/IMG_8765.9CbiwG1m.jpg",n="/assets/IMG_8761.y1KeLsbi.jpg",l="/assets/IMG_8750.tcxU7Wav.jpg",M="/assets/IMG_8751.S0p7z6Fp.jpg",d="/assets/IMG_8752.yDSko6MT.jpg",G="/assets/IMG_8753.T-aOr8Ee.jpg",I="/assets/IMG_8754.fXtU0DrQ.jpg",j="/assets/IMG_8755.nGkMHlPs.jpg",h="/assets/IMG_8756.AA1ZKgMi.jpg",u="/assets/IMG_8757.aVKW2X3b.jpg",T="/assets/IMG_8758.4tavTgLq.jpg",f="/assets/IMG_8759.-nTZhL7w.jpg",k="/assets/IMG_8760._uhlRKbk.jpg",x="/assets/IMG_8745.-Snl2UTa.jpg",S="/assets/IMG_8762.a_xohF06.jpg",$=JSON.parse('{"title":"Производственный коворкинг \\"Дар труда\\"","description":"","frontmatter":{"title":"Производственный коворкинг \\"Дар труда\\"","date":"2015-02-28","cover":"IMG_8747.jpg"},"headers":[],"relativePath":"workshop/tour/dar-truda-start/index.md","filePath":"workshop/tour/dar-truda-start/index.md"}'),A={name:"workshop/tour/dar-truda-start/index.md"},V=r('<p>Обзоры мастерских — хороший способ познакомиться с их внутренним устройством, возможностями и особенностями. Вы уже знаете, что <a href="/practice/process/dvor-sotrudnej-pereehal/" title="Двор Сотрудней переезжает">ремесленный коворкинг &quot;Двор Сотрудней&quot; переехал</a> на Преображенскую площадь и, сменив название, стал большим и мощным производственным коворкингом на первом этаже 16-ого корпуса на территории съехавшего в Подмосковье НИИ дальней радиосвязи (НИИДАР). Мы уже показывали фотографии нового просторного цеха, а с основным оборудованием познакомились еще в старой мастерской на Чистых прудах. Теперь настало время познакомиться поближе с новым цехом и лучше понять устройство общественной мастерской.</p><p><img src="'+a+'" alt=""><img src="'+o+'" alt=""><img src="'+p+'" alt=""><img src="'+e+'" alt=""><img src="'+c+'" alt=""></p><p>Вход в мастерскую скрывается за неприметной металлической дверью, которая ведёт в небольшой коридор, образованный обратной стороной шкафа с крупными инструментами. Чуть пройдя вперед мы попадаем в светлый просторный цех. Справа вдоль стены располагается стойка администратора и шкафы с инструментами. Резиденты и посетители мастерской могут получить здесь все необходимое от линейки и карандаша до шуруповерта и шлифмашинки. Здесь же поддерживается стабильный запас основных крепежей и можно не беспокоиться в случае, если в процессе работы не хватило нескольких саморезов.</p><p><img src="'+i+'" alt=""><img src="'+m+'" alt=""><img src="'+g+'" alt=""><img src="'+n+'" alt=""></p><p>Основное рабочее пространство состоит из двух зон: площадки со станками и зоны общих верстаков, за которыми происходит основная работа, а также проводятся мастер-классы. Воспользоваться верстаком и простым ручным и электрическим инструментом может каждый, а для доступа к серьезным станкам необходимо пройти краткий вводный курс, стоимость и продолжительность которого варьируется в зависимости от сложности оборудования. В качестве разделителя этих двух рабочих зон выступает большой шкаф для личного хранения, место в котором выделяется для каждого резидента, а также стеллаж с запасами материалов: фанеры, досок, брусков и прочего.</p><p><img src="'+l+'" alt=""><img src="'+M+'" alt=""><img src="'+d+'" alt=""><img src="'+G+'" alt=""><img src="'+I+'" alt=""><img src="'+j+'" alt=""></p><p>Дальше вглубь цеха находится гардероб с импровизированной раздевалкой и общий стол, за которым можно попить чая или даже чего-нибудь перекусить. В самом конце строятся из легких материалов отдельные комнаты для мастеров. Мастерская въехала в это помещение совсем недавно, но может показаться, что она здесь была всегда — так удачно вписались в интерьер оставленные в наследство переехавшим НИИ большие шкафы, столы и стеллажи. Удачно и мастерская вписалась в большой просторный цех с 6-метровыми потолками, краном-балкой и промышленным энергоснабжением и вытяжной системой. Конечно, это только самое начало, мастерская на глазах отстраивает сама себя, несмотря на периодическую загруженность заказами и ежедневный рабочий график.</p><p><img src="'+h+'" alt=""><img src="'+u+'" alt=""><img src="'+T+'" alt=""><img src="'+f+'" alt=""><img src="'+k+'" alt=""><img src="'+x+'" alt=""><img src="'+S+'" alt=""></p><p>Для посетителей и резидентов здесь предоставляется доступ к внушительному парку оборудования. В зале станков можно найти любимый многими большой и мощный форматно-раскроечный станок, ленточную пилу, сверлильный и точильные станки, циркулярную и торцовочную пилы, а также рейсмус, УШМ на подставке. В шкафах у стойки администратора и в углу зала можно обнаружить всевозможные электроинструменты: несколько шуруповёртов, различные шлифмашинки, электрорубанки, ручные фрезеры, дрели и другое оборудование, а также расходники к ним. В целом, для простых столярных работ здесь уже есть всё, включая некоторый запас базовых материалов на стойке в центре зала и на надстройке над входом. Вам остаётся только надеть одежду, которую не жалко и которая не будет мешаться при работе, также желательно захватить с собой защитные очки и перчатки, и можно приступать к творчеству. Не стесняйтесь задавать вопросы администратору и вы сможете открыть для себя всю широту возможностей работы в настоящей большой столярной мастерской.</p>',9),v=[V];function w(K,N,P,b,q,D){return t(),_("div",null,v)}const y=s(A,[["render",w]]);export{$ as __pageData,y as default};
